import React from "react";
import Typography from '@material-ui/core/Typography';
import Grid from "@material-ui/core/Grid"


function Agenda(props) {
  return (
    <div>
      <Grid
        container
        spacing={0}
        direction="column"
        alignItems="center"
        justify="center"
      >
      <Typography variant="h5" color="inherit">
        To Do
      </Typography>
    </Grid>
    </div>
  );
}

export default Agenda;
